interface propData {
    checkbox: boolean,
}


const Table = (props: propData) => {
    return (
        <>
            <table className="table table-hover table-nowrap mb-0">
       
                <tbody>
                    <tr>
                        {
                            props?.checkbox &&
                            <th scope="row">
                                <div className="form-check">
                                    <input className="form-check-input" type="checkbox" id="inlineCheckbox2" value="option1" checked />
                                </div>
                            </th>
                        }
                        <td>#541254265</td>
                        <td>Amezon</td>
                        <td>Cleo Carson</td>
                        <td>$4,521</td>
                        <td><a href="javascript:void(0);"><i className="ri-download-2-line"></i></a></td>
                    </tr>
                </tbody>
            </table>
        </>
    )
}

export default Table;
